package week1day2;

public class primenumber {

	public static void main(String[] args) {
		int x=0;
		int num=15;
		for(int i=1;i<num;i++)
		{
		if(num%i==0)
		{
			x++;
		}
		}
		if(x==1)
		{
		System.out.println("prime");
			}
		else
		{
			System.out.println("not prime");}
		}
		
		}
